import React from 'react';

const Disk = () => {
    return (
        <div className="disk">
            <div className="disk__btns">
                <button className="disk__back">Назад</button>
                <button className="disk__create">Создать папку</button>
            </div>
            <FileList/>
        </div>
    )
}
export default Disk;
